import React from 'react'

export default function Wines(props) {
    const { wines, currentUser } = props;

    return (
        <div>
            {wines.map(wine=> (
                <React.Fragment key={wine.id}>
                    <Link to={`/wines/${wine.id}`}></Link>
                </React.Fragment>
            ))}
        </div>
    )
}
